void UpdateCharAnimation(int c, AnimInitStruct_t *is) {
	CharData[c].AltAnimation = is->Animation;
	CharData[c].AltFrame = is->Frame;
	CharData[c].AltX = is->X;
	CharData[c].AltY = is->Y;
	CharData[c].HSpeed = is->HSpeed;
	UpdateFrameData(c);
	CopyOldToNew(c);
}

unsigned int Animate(CharData_t *ch, const FrameSequence_t *fs, unsigned int UpdateSpeed) {
	unsigned int result = FRAME_NOT_CHANGED;

	if(UpdateSpeed) {
        // Updating char H- and VSpeed with such values from fs
		if(fs->HSpeed)
			ch->HSpeed = fs->HSpeed;
		if(fs->VSpeed)
			ch->VSpeed = fs->VSpeed;
	}

	if((ch->Frame < fs->FirstFrame) || (ch->Frame > fs->LastFrame)) {
		ch->Frame = fs->FirstFrame;
		ch->AnimationDelay = 0;
		return FRAME_NOT_CHANGED;
	} else if(ch->AnimationDelay < fs->Delay) {
		 ch->AnimationDelay++;
		return FRAME_NOT_CHANGED;
	} else {
		if(++ch->Frame > fs->LastFrame) {
			ch->Frame = fs->FirstFrame;
			result |= ANIM_IS_OVER;
		}
		ch->AnimationDelay = 0;
		result |= FRAME_CHANGED;
	}
	return result;
}